★ナイキのスポーツクーラーボックス！<br>
<br>
●アスリートに使いやすい小容量ボックスタイプ！<br>
●折りたためばコンパクトに持ち運びが可能！<br>
●アイソテック5層断熱構造の高い保冷力！<br>
●調整可能ショルダーベルト(取り外し不可)。<br>
●底を守るエッジガード付き。<br>
●フロントメッシュポケット付き。<br>
●350ml缶なら6缶、500mlペットボトルで4本収納が可能！<br>
●スポーツシーンは勿論屋外レジャーや休日のお出かけにオススメです！<br>
<br>
■素材<br>
外生地：ポリエステル<br>
クッション(断熱材)：ポリウレタン、発泡ポリエチレン<br>
内生地：PEVA<br>
■企画製造販売元 サーモス株式会社<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
なお、商品の色の見え方と実物の色は、お客様のご使用されているパソコン・モニターの環境等により多少異なる場合がございますのでご了承ください。<br>
<BR>
